import React from 'react';
import VideoDisplay from "../VideoDisplay/VideoDisplay"
import VideoListStyle from "../VideoList/VideoList.scss"


function VideoList(props){

    console.log("props = ", props)
  return (
    
      <>
        <h2>NEXT VIDEO</h2>
        <ul>
          {props.videoDetail.map((video) => {
            return (
              <div>
              <img src={video.image}/>
              <li
                key={video.id}
                onClick={() => props.setCurrentVideo(video.id)}
              >
                {video.title}
                {video.channel}
               
              </li>
              </div>
               
            );
          })}
        </ul>
      </>
  )}

export default VideoList
